import zlib
import marshal
import base64
import importlib.util
import sys

def xor_decrypt(data: bytes, key: str) -> bytes:
    key_bytes = key.encode()
    return bytes(a ^ key_bytes[i % len(key_bytes)] for i, a in enumerate(data))

def decrypt_script(encrypted_script: str, key: str) -> bytes:
    encoded_code = encrypted_script.encode('utf-8')
    decrypted_code = xor_decrypt(base64.b85decode(encoded_code), key)
    compressed_code = decrypted_code
    decompressed_code = zlib.decompress(compressed_code)
    code_object = marshal.loads(decompressed_code)
    return code_object

